"use strict";
Component({
    data: {
        selected: 0,
        color: "#b0b0b0",
        selectedColor: "#fc5f46;",
        hidden: false,
        list: [{
                pagePath: "/pages/index/index",
                iconPath: "/assets/image/index.png",
                selectedIconPath: "/assets/image/indexs.png",
                text: "首页",
                selectedStyle: 1
            }, {
                pagePath: "/pages/user/mine",
                iconPath: "/assets/image/mine.png",
                selectedIconPath: "/assets/image/mines.png",
                text: "我的",
                selectedStyle: 2
            }]
    },
    methods: {
        switchTab: function (e) {
            var data = e.currentTarget.dataset;
            var url = data.path;
            var index = data.index;
            do {
                if (index === 2) {
                    wx.navigateTo({ url: url });
                    break;
                }
                wx.switchTab({ url: url });
            } while (false);
        },
        init: function () {
            var page = getCurrentPages().pop();
            this.setData({
                selected: this.data.list.findIndex(function (item) { return item.pagePath === "/" + page.route; }),
                hidden: true
            });
        }
    }
});
